// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract ScaryTeacherNFT is ERC721Enumerable, Ownable {
    using Strings for uint256;

    struct Referee {
        bool isReferred;
        address payable referrer;
    }

    string public collectionName = "ScaryTeacher"; // NTF collection name
    string public baseURI; // NTFs' Base URL
    string public baseExtension = ".json";  // Metadata extension
    uint256 public preSaleCost = 0.01 ether;
    uint256 public publicMintCost = 0.05 ether;
    uint256 public maxSupply = 10000;
    uint256 public maxMintAmount = 20;
    uint256 public maxNFTsPerWallet = 20;
    uint256 public referralBonusPercentage = 10;
    bool public paused = false;
    bool public isPreSale = true; // allow only whitelisted guys to mint
    //    address[] public mintingWhitelist; // these guys are allowed to mint in presale
    mapping(address => bool) public mintingWhitelist; // these guys are allowed to mint in presale
    mapping(address => bool) public notPayingWhitelist; // these guys won't pay while minting
    mapping(address => Referee) public referees; // people who have been referred

    constructor(
        string memory _name,
        string memory _symbol,
        string memory _initBaseURI
    ) ERC721(_name, _symbol) {
        setBaseURI(_initBaseURI);
        //         mint(msg.sender, 20);
    }

    // internal
    function _baseURI() internal view virtual override returns (string memory) {
        return baseURI;
    }

    // public
    function mint(address _to, uint256 _mintAmount) public payable {
        uint256 supply = totalSupply();
        require(!paused, "Minting is paused.");
        require(_mintAmount > 0, "At least mint 1.");
        require(_mintAmount <= maxMintAmount, "Minting limit exceeded.");
        require(supply + _mintAmount <= maxSupply, "Max supply exceeded.");
        //        require(msg.sender != owner(), "Collection owner cannot mint.");
        uint256 ownerTokenCount = balanceOf(_to);
        require(ownerTokenCount < maxNFTsPerWallet, "Wallet minting limit exceeded.");

        //        if (msg.sender != owner()) {// check if the caller is not the collection owner
        if (isPreSale == true) {// check if pres-sale is active
            require(isWhitelistedForMinting(_to), "User not whitelisted for mint.");

        }
        if (notPayingWhitelist[_to] == false) {// check if the guy should pay

            // pay
            if (isPreSale == true) {
                require(msg.value >= preSaleCost * _mintAmount, "ETH amount lower than pre-sale");
            } else {
                require(msg.value >= publicMintCost * _mintAmount, "ETH amount lower than public-sale");
            }

            if (referees[_to].isReferred) {
                address payable referrer = referees[msg.sender].referrer;
                uint256 cut = (msg.value * referralBonusPercentage) / 100;
                uint256 transferAmt = msg.value - cut;

                referrer.transfer(cut);

            }
        }
        //        }

        for (uint256 i = 1; i <= _mintAmount; i++) {
            _safeMint(_to, supply + i);
        }
    }

